def load_game_data(filepath):
    try:
        with open(filepath, "r", encoding="utf-8") as f:
            return json.load(f)
    except (FileNotFoundError, json.JSONDecodeError) as e:
        print(f"Рџа№ИЈ лЪлЙл╝лИл╗л║л░ лил░л▓л░лйЛѓл░лХлхлйлйЛЈ {filepath}: {e}")
